svg.script:
var a = document.getElementById("alphasvg");
	a.addEventListener("load",function(){

		// get the inner DOM of alpha.svg
		var svgDoc = a.contentDocument;
		// get the inner element by id
		var delta = document.getElementById("convenciones_gris");
		// add behaviour
		delta.addEventListener("mouseover",function(){
			var negra = document.getElementById("linea");
			if(negra.style.visibility === "hidden"){negra.style.visibility = "visible";}
				else {negra.style.visibility = "hidden";}
		},false);
		delta.addEventListener("click",function(){
				var beta = document.getElementById("convenciones");
				if(beta.style.visibility === "hidden"){beta.style.visibility = "visible";}
				else {beta.style.visibility = "hidden";}
		}, false);
	}, false);
